import {
    SET_BOARD_FILLED 
} from "../actions/types";

const initialState = {
    isBoardFilled: false,
    isTextBoxOpen: false,
    selectedModules: []
}

export default function (state = initialState, action) {
    switch (action.type) {
        case SET_BOARD_FILLED: 
            return {
                ...state,
                selectedModules: true
            }
        default:
            return state;
    }
}
